import React from 'react';

function PhonePopup() {
    return (
        <div>
            <table>
                <tbody>
                    <tr onClick={() => window.open('tel:1234567890')}>
                        <td>Hotline: 123-456-7890</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default PhonePopup;
